    false,nt"url": null,nt"notes": "The Upper Kenai Corridor study describes
    and evaluates the Upper Kenai River and the land which embraces it. It also places
    the river corridor in its regional context. The study describes the upper segment
    of the most popular sport fishing river in Alaska, and the diverse landscape surrounding
    it from Skilak Lake upstream to Kenai Lake, a total of 18 miles of river and over
    20,000 acres of land.    Two federal agencies, the Kenai National Wildlife Refuge
    and the Chugach National Forest Service administer over 75 percent of the corridor
    study area. The remaining land, around Cooper Landing, is in private, state, and
    Kenai Peninsula Borough ownership. Land ownership patterns will continue to influence
    land uses, which will effect future management philosophies and actions pertaining
    to the corridor.     The management actions of future corridor uses should place
    primary emphasis on the protection of resource and recreational values. Developments
    needed to facilitate and disperse access, to interpretate natural, cultural and
    recreational values, and to expand existing recreational opportunities in compatible
    zones are recommended. Critical water management actions, including three legal
    classifications of the river, wild, scenic and recreational, are also recommended.
    The study further recommends close cooperation among the Kenai National Wildlife
    Refuge and the Chugach National Forest Service as well as state and local governments
    and private interests.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
